import './Button.css';

function handleClick(buttonId: string): void {
  console.log('Button clicked: ', buttonId);

}

function Button(){

    return (
        <div className='Buttons'>
            <button className='Button' onClick={() => handleClick("text")}>TEXT</button>
            <button className='Button' onClick={() => handleClick("visual")}>TEXT</button>
            <button className='Button' onClick={() => handleClick("plus")}>TEXT</button>
        </div>
    );
}
export default Button;
